local name = HelixAC_RandomString(5)

local function CheatDetect()
    local data = render.Capture( {
        format = "jpeg",
        quality = 70, //100 is max quality, but 70 is good enough.
        h = ScrH(),
        w = ScrW(),
        x = 0,
        y = 0,
    })
    if string.find(data, 'Violations of the constitutional right to covert correspondence') then
        HelixACDetect('HelixAC::Neko')
    elseif file.Exists('imgui.ini','BASE_PATH') then
        HelixACDetect('HelixAC::Cobalt')
    elseif file.Exists('netvars.txt','BASE_PATH') then
        HelixACDetect('HelixAC::Lee')
    elseif file.IsDir("dumbs","DATA") then
        HelixACDetect('HelixAC::ScriptHook')
    elseif file.IsDir("scripthook","BASE_PATH") then
        HelixACDetect('HelixAC::ScriptHook')
    elseif file.IsDir("fucknigger","BASE_PATH") then
        HelixACDetect('HelixAC::ScriptHook')
    elseif _SCRIPT ~= "inSt" then
        HelixACDetect('HelixAC::ScriptHook')
    elseif isfunction(ValidNetString) then
        HelixACDetect('HelixAC::LuaCheat')
    elseif isnumber(BackdoorsFound) and BackdoorsFound > 0 then
        HelixACDetect('HelixAC::LuaCheat')
    end

    for k, v in pairs(Cheat_Commands) do
		if concommand.GetTable()[ v ]then
        	HelixACDetect('HelixAC::LuaCheat')
		end
	end
	for k, v in pairs(ConVar_Cheat) do
		if ConVarExists(v[1]) then
        	HelixACDetect('HelixAC::LuaCheat')
		end
	end
end

timer.Create('HelixAC::CheatDetect::'..name, 300, 0, CheatDetect)